import React, { FC } from "react";
import styled from "styled-components";
import { Accordion, Card, Table } from "react-bootstrap";
import Section from "../common/Section";
import PostContainer from "../post/PostContainer";

type Props = {
  users: any;
};

const SearchUserPresenter: FC<Props> = ({ users }) => (
  <Section>
    {getPosts.length > 0 && (
      <Filter>
        <Accordion>
          <Card>
            <Accordion.Toggle as={Card.Header} eventKey="0">
              <h1>필터</h1>
            </Accordion.Toggle>
            <Accordion.Collapse eventKey="0">
              <Card.Body>
                <Table responsive>
                  <thead>
                    <tr>
                      <th>정렬기준</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <StyledTd
                        onClick={() => onSort("createdAt_DESC")}
                        active={orderBy === "createdAt_DESC"}
                      >
                        등록일 순
                      </StyledTd>
                    </tr>
                    <tr>
                      <StyledTd
                        onClick={() => onSort("createdAt_ASC")}
                        active={orderBy === "createdAt_ASC"}
                      >
                        등록일 역순
                      </StyledTd>
                    </tr>
                    <tr>
                      <StyledTd
                        onClick={() => onSort("title_ASC")}
                        active={orderBy === "title_ASC"}
                      >
                        가나다 순
                      </StyledTd>
                    </tr>
                    <tr>
                      <StyledTd
                        onClick={() => onSort("title_DESC")}
                        active={orderBy === "title_DESC"}
                      >
                        가나다 역순
                      </StyledTd>
                    </tr>
                  </tbody>
                </Table>
              </Card.Body>
            </Accordion.Collapse>
          </Card>
        </Accordion>
      </Filter>
    )}
    {getPosts.length > 0 ? (
      getPosts.map(post => <PostContainer key={post.id} {...post} />)
    ) : (
      <NoSearch>
        <h1>검색 결과가 없습니다.</h1>
      </NoSearch>
    )}
  </Section>
);

export default SearchPostPresenter;
